import{_ as a,o as e,c as n,e as i}from"./app.c1b646c2.js";const r={},d=i('<h1 id="bagan" tabindex="-1"><a class="header-anchor" href="#bagan" aria-hidden="true">#</a> Bagan</h1><p>Misskey dapat menghasilkan dan menampilkan bagan untuk sumber data berbagai instansi yang terfederasi. Bagan memungkinkan kamu untuk mendapatkan representasi gambaran dari penggunaan, status federasi, dan aktivitas setiap pengguna.</p><p>Bagan instansi dapat dilihat dari halaman <em>informasi instansi</em> (dapat diakses dengan mengeklik logo instansi dalam menu navigasi).</p><p>Berikut di bawah ini merupakan deskripsi dari setiap bagan dan isinya.</p><h2 id="bagan-federasi" tabindex="-1"><a class="header-anchor" href="#bagan-federasi" aria-hidden="true">#</a> Bagan Federasi</h2><p>Bagan ini menampilkan informasi tentang instansi yang terfederasi.</p><h3 id="pub" tabindex="-1"><a class="header-anchor" href="#pub" aria-hidden="true">#</a> Pub</h3><p>Jumlah instansi luar yang menerima aktivitas publikasi dari instansi ini.</p><h3 id="sub" tabindex="-1"><a class="header-anchor" href="#sub" aria-hidden="true">#</a> Sub</h3><p>Jumlah instansi luar yang mempublikasikan aktivitasnya ke instansi ini.</p><h3 id="received" tabindex="-1"><a class="header-anchor" href="#received" aria-hidden="true">#</a> Received</h3><p>Jumlah instansi yang telah mengirim aktivitasnya ke instansi ini.</p><h3 id="delivered" tabindex="-1"><a class="header-anchor" href="#delivered" aria-hidden="true">#</a> Delivered</h3><p>Jumlah instansi yang menerima aktivitas dari kiriman instansi ini.</p><h3 id="stalled" tabindex="-1"><a class="header-anchor" href="#stalled" aria-hidden="true">#</a> Stalled</h3><p>Jumlah instansi dimana kesalahan ditemukan ketika mengirimkan aktivitas.</p><h2 id="bagan-pengguna-aktif" tabindex="-1"><a class="header-anchor" href="#bagan-pengguna-aktif" aria-hidden="true">#</a> Bagan Pengguna Aktif</h2><p>Bagan dari aktivitas pengguna pada instansi ini.</p><h3 id="baca-tulis" tabindex="-1"><a class="header-anchor" href="#baca-tulis" aria-hidden="true">#</a> Baca &amp; Tulis</h3><p>Jumlah pengguna yang telah membaca dan menulis.</p><h3 id="read" tabindex="-1"><a class="header-anchor" href="#read" aria-hidden="true">#</a> Read</h3><p>Jumlah pengguna yang telah membaca.</p><h3 id="write" tabindex="-1"><a class="header-anchor" href="#write" aria-hidden="true">#</a> Write</h3><p>Jumlah pengguna yang telah menulis.</p><h3 id="week" tabindex="-1"><a class="header-anchor" href="#week" aria-hidden="true">#</a> &lt; Week</h3><p>Jumlah pengguna dengan umur akun kurang dari satu minggu.</p><h3 id="month" tabindex="-1"><a class="header-anchor" href="#month" aria-hidden="true">#</a> &lt; Month</h3><p>Jumlah pengguna dengan umur akun kurang dari satu bulan.</p><h3 id="year" tabindex="-1"><a class="header-anchor" href="#year" aria-hidden="true">#</a> &lt; Year</h3><p>Jumlah pengguna dengan umur akun kurang dari satu tahun.</p><h3 id="week-1" tabindex="-1"><a class="header-anchor" href="#week-1" aria-hidden="true">#</a> &gt; Week</h3><p>Jumlah pengguna dengan umur akun lebih dari satu minggu.</p><h3 id="month-1" tabindex="-1"><a class="header-anchor" href="#month-1" aria-hidden="true">#</a> &gt; Month</h3><p>Jumlah pengguna dengan umur akun lebih dari satu bulan.</p><h3 id="year-1" tabindex="-1"><a class="header-anchor" href="#year-1" aria-hidden="true">#</a> &gt; Year</h3><p>Jumlah pengguna dengan umur akun lebih dari satu tahun.</p>',36),h=[d];function t(s,u){return e(),n("div",null,h)}var l=a(r,[["render",t],["__file","charts.html.vue"]]);export{l as default};
